import React from 'react'
import {Avatar } from '@material-ui/core'
const Incredients = ({item}) => {
    return (
        <div className="incredient">
            <div>
                <Avatar>{item.amount}</Avatar>
                <small>{item.unit}</small>
            </div>
            <p className="incredient_name">
                {item.name}
            </p>

            {/* <li><span>{item.amount} {item.unit}</span>{item.name}</li> */}

        </div>
    )
}

export default Incredients
